import React from 'react';
import { VscAccount } from 'react-icons/vsc';
import { Link } from 'react-router-dom';

const SellerHomePage = () => {
  return (
    <div>
      {/* Header */}
      <header style={styles.header}>
        <div style={styles.logoContainer}>
          <h1 style={styles.logo}>Auction Platform</h1>
        </div>
        <div style={styles.userContainer}>
          <nav style={styles.nav}>
            <Link to="/homepage" style={styles.navLink}>
              Home
            </Link>
            <Link to="#categories" style={styles.navLink}>
              Contact Us
            </Link>
            <Link to="#sell" style={styles.navLink}>
              Sell
            </Link>
          </nav>
          <div style={styles.userIconContainer}>
            <VscAccount style={styles.userIcon} />
          </div>
        </div>
      </header>

      {/* Seller Home Content */}
      <section style={styles.sellerContent}>
        <div style={styles.sellerContainer}>
          <h2 style={styles.sellerTitle}>Become a Seller</h2>
          <p style={styles.sellerDescription}>
            Start selling your items on our platform. Follow the steps below to list your item.
          </p>
          <button style={styles.listItemButton}>List Your Item</button>
        </div>
        <div style={styles.sellerSteps}>
          {/* Seller Steps */}
          <div style={{ ...styles.step, backgroundColor: '#4CAF50' }}>
            <p>Step 1</p>
            <p>Create an Account</p>
          </div>
          <div style={{ ...styles.step, backgroundColor: '#2196F3' }}>
            <p>Step 2</p>
            <p>Verify Your Identity</p>
          </div>
          <div style={{ ...styles.step, backgroundColor: '#FFC107' }}>
            <p>Step 3</p>
            <p>List Your Item</p>
          </div>
          <div style={{ ...styles.step, backgroundColor: '#FF5722' }}>
            <p>Step 4</p>
            <p>Set Your Price</p>
          </div>
          <div style={{ ...styles.step, backgroundColor: '#9C27B0' }}>
            <p>Step 5</p>
            <p>Ready to Sell!</p>
          </div>
        </div>
      </section>

      {/* Footer */}
      <footer style={styles.footer}>
        <p style={styles.footerText}>Auction Hub &copy; 2024</p>
        <p style={styles.footerText}>
          <strong>Kaliraj M & Sridhar R</strong>
        </p>
      </footer>
    </div>
  );
};

const styles = {

    body: {
        margin: 0,
        padding: 0,
      },

      header: {
        backgroundColor: '#1a237e',
        // padding: '15px',
        color: '#fff',
        display: 'flex',
        justifyContent: 'space-between',
        alignItems: 'center',
        position: 'sticky',
        top: 0,
        width: '100%',
        zIndex: 1000,
      },
    
      footer: {
        backgroundColor: '#1a237e',
        color: '#fff',
        textAlign: 'center',
        padding: '10px',
        width: '100%', 
      },

  logoContainer: {
    display: 'flex',
    alignItems: 'center',
  },
  logo: {
    margin: 0,
    fontSize: '24px',
    color: "#fff",
  },
  nav: {
    display: 'flex',
  },
  navLink: {
    color: '#fff',
    margin: '0 15px',
    textDecoration: 'none',
    fontSize: '16px',
  },

  userIconContainer: {
    position: 'relative',
    cursor: 'pointer',
  },

  sellerContent: {
    padding: '80px 20px',
    backgroundColor: '#f4f4f4',
    marginTop: '70px',
    textAlign: 'center',
    width: '100%', 
    boxSizing: 'border-box',
  },

  sellerContainer: {
    maxWidth: '600px',
    margin: '0 auto',
    boxSizing: 'border-box',
  },

  sellerTitle: {
    fontSize: '32px',
    marginBottom: '20px',
    color: '#333',
  },

  sellerDescription: {
    fontSize: '18px',
    color: '#555',
    marginBottom: '40px',
  },

  listItemButton: {
    backgroundColor: '#1a237e',
    color: '#fff',
    padding: '15px 30px',
    border: 'none',
    borderRadius: '5px',
    cursor: 'pointer',
    fontSize: '18px',
    transition: 'background-color 0.3s ease-in-out',
  },

  sellerSteps: {
    display: 'flex',
    justifyContent: 'space-around',
    marginTop: '40px',
  },

  step: {
    flex: 1,
    padding: '20px',
    color: '#fff',
    textAlign: 'center',
    fontSize: '20px',
    fontWeight: 'bold',
  },

  userIcon: {
    width: '30px',
    height: '30px',
    borderRadius: '50%',
    margin: '0 15px',
  },

  dropdown: {
    position: 'absolute',
    top: '100%',
    right: 0,
    backgroundColor: '#fff',
    boxShadow: '0 4px 8px rgba(0, 0, 0, 0.1)',
    borderRadius: '5px',
    padding: '8px',
    zIndex: 1000,
    textAlign: 'right',
  },

  dropdownItem: {
    display: 'block',
    textDecoration: 'none',
    color: '#333',
      cursor: 'pointer',
      padding: '8px',
      transition: 'background-color 0.3s ease-in-out, color 0.3s ease-in-out',
  },

  dropdownItemHover: {
    backgroundColor: '#f0f0f0',
  },

  banner: {
    backgroundColor: '#4285f4',
    textAlign: 'center',
    color: '#fff',
    padding: '70px 0', 
    marginTop: '570px', 
  },

  userContainer: {
    display: 'flex',
    alignItems: 'center',
  },
  
  footerText: {
    margin: 0,
    color: "#fff",
    fontSize: '14px',
  },

  bannerText: {
    fontSize: '24px',
    margin: 0,
  },
};

export default SellerHomePage;
